  false,\n\t\"url\": null,\n\t\"notes\": \"Performance indicators for landings, effort,
  revenue and distribution of revenue are collected for various fisheries nation-wide.
  The fisheries include catch and non-catch share fisheries.Catch shares is a general
  term to describe fishery management programs that dedicate a secure share of fish
  to individual fishermen, cooperatives or fishing communities for their exclusive
  use. These programs have been in existence for more than 20 years in the United
  States. NOAA Fisheries recently began a systematic collection of performance indicators
  for all U.S. Catch Share Programs. Performance indicators for catch share programs
  are collected for 15 selected catch share programs in the United States. Additionally,
  selected non-catch share fisheries are also selected for inclusion.\",\n\t\"owner_org\":
